import React, { Component } from 'react';
import ReactDOM from 'react-dom';

import {
    BrowserRouter as Router,
    Switch,
    Route,
    useParams
  } from 'react-router-dom';

    
   function Location_hotel (props) {
        const {location}= useParams();
        return (
            <div  className="container">
                <h4 className="mb-4">Card Deck Responsive {location} </h4>
               <div className="col-sm-2"> 
             
                </div>
                 
                <div className=" card card-deck col-sm-9"> 
                <img src="/images/home/danang.jpg" style={{width:'350px'}} className="img-thumbnail rounded float-left"/>
                    <div className="card mb-4 float-right ">                                                   
                        <div className="card-body">
                            <h4 className="card-title"> {location} : <span className="text-primary font-weight-bolder"> Quang Trung Hotel</span> </h4>
                            <p className="card-text text-info "> Price : <h4> 230$ </h4> </p>
                            <a className="text-link"><i class="fa fa-map-marker" aria-hidden="true"></i> 1118 Quang Trung, Phường 8, Gò Vấp, Thành phố Hồ Chí Minh, Vietnam </a>
                            <p className="card-text"> Situated on the unspoilt shores of Hoi An Beach, Four Seasons The Nam Hai, Hoi An, Vietnam offers luxurious villas with iPod docks and free WiFi access. It boasts 3 beachfront pools and a spa. </p>
                        </div>
                    </div>                
                </div>
            </div>
        );
    }


export default Location_hotel;
